function initBannerBg() {
    $(".theater .swiper-slide").each(function(){
            var img_src = $(this).data("src");
            $(this).css({
                "background-image": "url("+img_src+")",
            });
    })
}
function getQueryStringRegExp(t){
    var i=new RegExp("(^|\\?|&)"+t+"=([^&^#]*)(\\s|[&|#]|$)","i");
    return i.test(location.href)?unescape(RegExp.$2.replace(/\+/g," ")):"";
}

function showDialog(id) {
    $("#cover").fadeIn(300);
    $("#"+id).addClass("active");
}
function hideDialog(id) {
    $("#cover").fadeOut(300);
    $("#"+id).removeClass("active");
}

function toId(id) {
    var idT = $("#"+id).offset().top, headerH = $(".header").outerHeight(), subnavH = $(".subnav").outerHeight()||0;
    $("html,body").animate({
        scrollTop: idT - headerH - subnavH
    },500);
}

function toClass(_class) {
    var classT = $("."+_class).offset().top, headerH = $(".header").outerHeight();
    $("html,body").animate({
        scrollTop: classT - headerH
    },500);
}

function throttle(method,context){
    clearTimeout(method.tId);            //{1}
    method.tId = setTimeout(function(){
        method.call(context);            //{2}
    },100);
}

function groupNum() {
    var num = 0, col = 0 ,startP , endP;
    $(".portfolio-item").each(function(index) {
        startP = $(".portfolio-item").eq(num).offset().top;
        endP  = $(this).offset().top;
        if(endP > startP) {
            col++;
            num = index;
        }
        $(this).attr("data-col","col"+col);
    });

}
$(window).resize(function(){
    throttle(groupNum);
    $(".portfolio-detail").remove();
    $(".portfolio-item").removeClass("active")
})

function slideArrow(t){
    var len = t.slides.length, w = t.width;
    var activeIndex = t.activeIndex;
    if(activeIndex == 0 ){
        var prevYear = ""
    }
    else {
        var prevYear = $(".swiper-slide").eq(activeIndex-1).find(".year").eq(0).text();
    }

    if(activeIndex == len-1) {
        var nextYear = "";
    }
    else {
        var nextYear = $(".swiper-slide").eq(activeIndex+1).find(".year").eq(0).text();
    }

    // var year = $(".swiper-slide").eq(activeIndex).find(".year").eq(0).text();

    if($(".swiper-nav li").length==0){
        var pX = $(".swiper-nav").position().left + w/len/2-10;
    }
    else {
        var pX = $(".swiper-nav li").eq(activeIndex).position().left + w/len/2-10;
    }
    var pY = $(".swiper-nav").position().top+30;
    $(".fx-right-arrow").html(nextYear);
    $(".fx-left-arrow").html(prevYear);

    return {"pX": pX, "pY":pY};
}



$(function(){
    $("#btn-menu").click(function () {
        $("#menu").toggleClass("show");
        $(this).toggleClass("on")
    });
    $(".weChatLink").click(function () {
        showDialog("weChatQR");
    })
    $("#weChatQR .disclaimer-exit").click(function () {
        hideDialog("weChatQR");
    });

    $(".casestudies dt").click(function(){
        $(this).parent("dl").toggleClass("fx-on").siblings("dl").removeClass("fx-on");
        $(this).next("dd").slideToggle(500);
        $(this).parent("dl").siblings("dl").find("dd").slideUp(500);
    })
    // 
    try {
        // Banner
        initBannerBg();

        var frontSwiper = new Swiper ('#frontBanner .swiper-container', {
            loop: true,
            effect: "fade",
            speed: 1000,
            fadeEffect: {
                crossFade: true,
            },
            pagination: {
                el: '.swiper-pagination',
                clickable: true
            },
            autoplay: {
                delay: 3000,
                disableOnInteraction: false,
            },
            on: {
                init: function() {
                    $("#frontBanner .swiper-pagination").wrap('<div class="content"></div>')
                }
            }
        });
        // frontSwiper.update();

        var slidePerView = 5, slidesPerGroup = 5;

        function initPortfolioNum() {
            var ww = $(window).width();
            if(ww<480) {
                slidePerView = 2;
                slidesPerGroup = 2;
            }
            else if(ww<780) {
                slidePerView = 3;
                slidesPerGroup = 3;
            }
        }

        initPortfolioNum();


        var portfolioSwiper = new Swiper('.portfolios .swiper-container', {
            // loop: true,
            slidesPerView: slidePerView,
            slidesPerGroup: slidesPerGroup,
            loopFillGroupWithBlank: true,
            /*scrollbar: {
                el: '.swiper-scrollbar',
                draggable: true,
            },*/
            observer:true,
            observeParents:true,
            speed: 1000,
            autoplay: {
                delay: 3000,
                disableOnInteraction: false,
            },
            on: {
                resize: function(){
                    var ww = $(window).width();
                    if(ww<480) {
                        this.params.slidesPerView = 2;
                        this.params.slidesPerGroup = 2;
                    }
                    else if(ww<780) {
                        this.params.slidesPerView = 3;
                        this.params.slidesPerGroup = 3;
                    }
                    else {
                        this.params.slidesPerView = 5;
                        this.params.slidesPerGroup = 5;
                    }
                }
            }

        });

        var aboutSwiper = new Swiper('.timeline .swiper-container', {
            pagination: {
                el: '.swiper-nav',
                clickable: true,
                speed: 1000,
                // type: 'custom',
                renderBullet: function (index, className) {
                    return '<li class="' + className + '">' + $(".swiper-slide").eq(index).find(".year").eq(0).text() + '</li>';
                },
            },
            navigation: {
                nextEl: '.fx-right-arrow',
                prevEl: '.fx-left-arrow',
            },
            on: {
                init: function(){
                    var slideA = slideArrow(this);
                    $(".timeline").append('<span class="pointer" style="left: '+ slideA.pX +'px; top: '+ slideA.pY +'px;"></span>');

                },
                slideChange: function() {
                    var slideA = slideArrow(this);
                    $(".timeline span.pointer").css({
                        "left": slideA.pX,
                        "top": slideA.pY
                    });
                    $(".fx-right-arrow .span").html(slideA.year);
                    $(".fx-left-arrow .span").html(slideA.prevYear);
                }
            },
            observer: true,
            observeParents:true,
        });


        if(location.hash !=""){
            var hash = location.hash.substring(1);
            toId(hash);
        }
    }catch(e){};

    $(".top").click(function(){
        $("html,body").animate({
            scrollTop: 0
        },500);
    })


    $(".select span").click(function(event){
        $(this).parent(".select").toggleClass("on");
        event.stopPropagation();
    });



    $(document).click(function(event){
        if($(".select").hasClass("on")) {
            $(".select").removeClass("on");
        }
    })

    $("[data-scroll]").click(function(){
        var className = $(this).data("scroll");
        toClass(className);
    });

    
})

// alert(!!window.Modernizr.flexbox);



$(window).scroll(function(){
    var $this = $(this), wh = $this.height(), st = $this.scrollTop();

    $(".set").each(function () {
        var offTop = $(this).offset().top;
        if(offTop<(wh+st)){
            $(this).addClass("setof");
        }
    });
});
